import React from "react";
import ReactDOM from "react-dom";
import image1 from "../images/1.png";

const Card = (props) => {
  return (
    <div>
      <div class="grid-item">
        <img src={image1} />
        <div class="info">
          <h4 class="project-name">{props.title}</h4>
          <h4 class="project-type">{props.type}</h4>
        </div>
      </div>
    </div>
  );
};

export default Card;
